import { useEffect, useState } from 'react';
import './App.css';
// import Todo from './components/todo';

function App() {
  const [todos,setTodos]=useState()

  useEffect(()=>{
    const url = 'https://jsonplaceholder.typicode.com/todos';

    fetch(url)
    .then((res)=> {
      return res.json()
    })
    .then((data)=> {
        console.log(data)
        setTodos(data)
    })
  },[]);

  return (
    <div className="container">
      {/* <Todo /> */}

            <table>
              <thead>
                <th>ID</th>
                <th>Title</th>
                <th>Status</th>
              </thead>
                {todos && todos.map((todo)=>{
                  return(
                    <tbody className='m-3'>
                    <td className='m-3'>{todo.id}</td>
                    <td className='m-3'>{todo.title}</td>
                    <td className={`{todo.completed? 'success' : 'danger'}m-3`} >
                      {todo.completed? 'Completed' : 'Pending'}
                    </td>
                    </tbody>
                  )
                })}
            </table>


    </div>
  );
}

export default App;
